import Title from './Title.js';
import SearchBox from './SearchBox.js';
import SearchResultsTable from './SearchResultsTable.js'


class Main extends Component {
    render () {
    return <div>
                <Title/>
                <SearchBox/>
                <SearchResultsTable/>
            </div>  
    }
}

export default Main
